/**
 *
 * @param {{hostname: string, architecture: string, platform: string,uptime: string,cpu:string,memory: string,network: string,date: string}} props
 */
function Report(props) {
    return <div>
        <h1>Host Name: {props.hostname}</h1>
        <ul>
            <li>Architecture: {props.architecture}</li>
            <li>Platform: {props.platform}</li>
            <li>Up Time: {props.uptime} seconds</li>
            <li>Memory: {JSON.stringify(props.memory.used/1024)}</li>
            <li>CPU: {props.cpu[0].model}
                <ul>
                    {props.cpu.map((proc, idx)=>{
                        return <li key={idx}>{proc.model} ({proc.speed}): {JSON.stringify(proc.usage)}</li>
                    })}
                </ul>
            </li>
        </ul>
    </div>
}

export default Report;
